me and temperature displays; and Fuelight digit displays designed for the petroleum industry. Further, it provides ADFLOW DMS systems that include indoor networked solutions for retailers, convenience stores, and other businesses; and Venus Control Suite, Show Control, Vanguard, and others, as well as maintenance and professional services related to its products. The company sells its products through direct sales and resellers. Daktronics, Inc. was founded in 1968 and is headquartered in Brookings, South Dakota.","Canterbury Park Holding Corporation, through its subsidiaries, engages in horse racing, card casino, food and beverage, and real estate development businesses. The company's Horse Racing segment operates year-round simulcasting of horse races, as well as wagering on live thoroughbred and quarter horse races on a seasonal basis. Its Card Casino segment offers unbanked card games, such as poker and table games. The company's Food and Beverage segment operates concession stands, restaurants and buffets, bars, and other food venues, as well as caf\u00e9 style restaurants and full-service bars within the Card Casino and simulcast area. This segment also provides lounge services along with a buffet restaurant; various concession style food and beverages during live racing; and catering and events services. Its Development segment engages in various development opportunities, such as residential development, office, restaurants, hotel, entertainment, and retail operations. The company is also involved in the provision of related services and activities, such as parking, advertising signage, publication sales, and other entertainment events and activities. Canterbury Park Holding Corporation was founded in 1994 and is based in Shakopee, Minnesota.","Franklin Electric Co., Inc., together with its subsidiaries, designs, manufactures, and distributes water and fuel pumping systems worldwide. It operates through three segments: Water Systems, Fueling Systems, and Distribution. The Water Systems segment offers submersible motors, pumps, drives, electronic controls, water treatment systems, monitoring devices, and related parts and equipment. Its motors and pumps are used principally for pumping clean water and wastewater in various residential, agricultural, municipal, and industrial applications; and manufactures electronic drives and controls that are used in motors for controlling functionality, as well as provides protection from various hazards, such as electrical surges, over-heating, and dry wells or tanks. The Fueling Systems segment provides pumps, pipes, sumps, fittings, vapor recovery components, electronic controls, monitoring devices, and related parts and equipment primarily for use in fueling system applications. This segment serves other energy markets, such as power reliability systems, as well as includes electronic devices for online monitoring of the power utility, hydroelectric, and telecommunication and data center infrastructure. The Distribution segment sells to and provides presale support and specifications to the installing contractors. It sells products produced by the Water Systems segment. The company sells its products to wholesale and retail distributors, specialty distributors, original equipment manufacturers, industrial and petroleum equipment distributors, and oil and utility companies through its employee sales force and independent manufacturing representatives. Franklin Electric Co., Inc. was founded in 1944 and is headquartered in Fort Wayne, Indiana.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Formula Systems (1985) Ltd., through its subsidiaries, provides proprietary and non-proprietary software solutions, IT professional services, software product marketing and support, and computer infrastructure and integration solutions worldwide. The company offers computer and telecommunication infrastructure solutions; computer solutions to computer and communications infrastructures; cloud computing solutions; and database and big data services. It also provides customer relations management, computer systems management infrastructures, web world content management, database and data warehouse mining, application integration, database and system, data management, and software development tools; and professional training courses and advanced professional studies. In addition, it markets and sells computers and peripheral equipment to business customers; offers property and casualty insurance platforms, such as Sapiens, Sapiens CoreSuite, Sapiens IDITSuite, Sapiens PolicyPro, Sapiens BillingPro, Sapiens ClaimsPro, e-Tica, and Tia Enterprise; life, pension, and annuities platforms, including Sapiens CoreSuite, Sapiens UnderwritingPro, Sapiens ApplicationPro, Sapiens IllustrationPro, and Sapiens ConsolidationMaster; reinsurance software solutions comprising Sapiens ReinsuranceMaster, Sapiens ReinsurancePro, and Sapiens Reinsurance GO; and Sapiens platform for workers' compensation solutions. Further, the company provides financial and compliance solutions that include Sapiens FinancialPro, Sapiens Financial GO, and Sapiens StatementPro; Sapiens DECISION, a decision management platform; and technology-based solutions. Additionally, it offers application development and business process integration platforms; vertical software solutions; strategic consulting and outsourcing services; and professional services in various areas, as well as develops on-premise payroll software. Formula Systems (1985) Ltd. was incorporated in 1985 and is headquartered in Or Yehuda, Israel.","Enstar Group Limited acquires and manages insurance and reinsurance companies, and portfolios of insurance and reinsurance business in run-off. It engages in the run-off property and casualty, and other non-life lines insurance businesses. The company also provides consulting services, including claims inspection, claims validation, reinsurance asset collection, syndicate management, and IT consulting services to the insurance and reinsurance industry. It operates in Bermuda, the United States, the United Kingdom, Australia, and other Continental European countries. The company was formerly known as Castlewood Holdings Limited and changed its name to Enstar Group Limited in January 2007. The company was founded in 1993 and is headquartered in Hamilton, Bermuda.","Agilent Technologies, Inc. provides application focused solutions to the life sciences, diagnostics, and applied chemical markets worldwide. The Life Sciences and Applied Markets segment offers liquid chromatography systems and components; liquid chromatography mass spectrometry systems; gas chromatography systems and components; gas chromatography mass spectrometry systems; inductively coupled plasma mass spectrometry instruments; atomic absorption instruments; microwave plasma-atomic emission spectrometry instruments; inductively coupled plasma optical emission spectrometry instruments; raman spectroscopy; cell analysis plate based assays; flow cytometer; real-time cell analyzer; cell imaging systems; microplate reader; laboratory software; information management and analytics; laboratory automation and robotic systems; dissolution testing; vacuum pumps, and measurement technologies. The Diagnostics and Genomics segment provides arrays for DNA mutation detection, genotyping, gene copy number determination, identification of gene rearrangements, DNA methylation profiling, gene expression profiling, next generation sequencing, target enrichment and genetic data management, and interpretation support software; and produces synthesized oligonucleotide. It also offers immunohistochemistry in situ hybridization, and hematoxylin and eosin staining and special staining; consumables, and software for quality control analysis of nucleic acid samples; and reagents for use in turbidimetry and flow cytometry, as well as develops liquid-based pharmacodiagnostics. The Agilent CrossLab segment provides GC and LC columns, sample preparation products, custom chemistries, and laboratory instrument supplies; and startup, operational, training, compliance support, software as a service, asset management, and consultation services. The company markets its products through direct sales, distributors, resellers, manufacturer's representatives, and electronic commerce. Agilent Technologies, Inc. was incorporated in 1999 and is headquartered in Santa Clara, California.","Great Elm Group, Inc. is an alternative asset management company focused on growing a scalable and diversified portfolio of long-duration and permanent capital vehicles across credit, real estate, specialty finance, and other alternative strategies. With its subsidiaries, it currently manages Great Elm Capital Corp., a publicly-traded business development company, and Monomoy Properties REIT, LLC, an industrial-focused real estate investment trust, in addition to other investments. The company was founded in 1994 and is headquartered in Waltham, MA.","TE Connectivity Ltd., together with its subsidiaries, manufactures and sells connectivity and sensor solutions in Europe, the Middle East, Africa, the Asia\u0096Pacific, and the Americas. The company operates through three segments: Transportation Solutions, Industrial Solutions, and Communications Solutions. The Transportation Solutions segment provides terminals and connector systems and components, sensors, relays, antennas, heat shrink tubing, and application tooling products for use in the automotive, commercial transportation, and sensor markets. The Industrial Solutions segment offers terminals and connector systems and components; and heat shrink tubing, interventional medical components, relays, and wires and cables for aerospace, defense, oil and gas, industrial equipment, medical, and energy markets. The Communications Solutions segment supplies electronic components, such as terminals and connector systems and components, relays, heat shrink tubing, and antennas for the data and devices, and appliances markets. TE Connectivity Ltd. sells its products to approximately 140 countries primarily through direct sales to manufacturers, as well as through third-party distributors. The company was formerly known as Tyco Electronics Ltd. and changed its name to TE Connectivity Ltd. in March 2011. TE Connectivity Ltd. was incorporated in 2000 and is based in Schaffhausen, Switzerland.","ECB Bancorp, Inc. focuses on operating as a holding company for Everett Co-operative Bank that provides various banking products and services. The company accepts various deposit products, including certificate of deposit accounts, IRAs, money market accounts, savings accounts, demand deposit accounts, and interest-bearing and noninterest-bearing checking accounts. It also offers one- to four-family residential real estate, commercial real estate and multifamily real estate, construction and land, commercial, and consumer loans, as well as home equity loans and lines of credit. In addition, the company invests in securities, consisting primarily of U.S. government and federal agency obligations, mortgage-backed securities, and corporate bonds. It operates through two full-service banking offices located in Everett, Massachusetts and Lynnfield, Massachusetts. The company was founded in 1890 and is based in Everett, Massachusetts.","The Procter &amp; Gamble Company provides branded consumer packaged goods worldwide. It operates through five segments: Beauty; Grooming; Health Care; Fabric &amp; Home Care; and Baby, Feminine &amp; Family Care. The Beauty segment offers conditioners, shampoos, styling aids, and treatments under the Head &amp; Shoulders, Herbal Essences, Pantene, and Rejoice brands; and antiperspirants and deodorants, personal cleansing, and skin care products under the Olay, Old Spice, Safeguard, Secret, and SK-II brands. The Grooming segment provides shave care products and appliances under the Braun, Gillette, and Venus brand names. The Health Care segment offers toothbrushes, toothpastes, and other oral care products under the Crest and Oral-B brand names; and gastrointestinal, rapid diagnostics, respiratory, vitamins/minerals/supplements, pain relief, and other personal health care products under the Metamucil, Neurobion, Pepto-Bismol, and Vicks brands. The Fabric &amp; Home Care segment provides fabric enhancers, laundry additives, and laundry detergents under the Ariel, Downy, Gain, and Tide brands; and air care, dish care, P&amp;G professional, and surface care products under the Cascade, Dawn, Fairy, Febreze, Mr. Clean, and Swiffer brands. The Baby, Feminine &amp; Family Care segment offers baby wipes, taped diapers, and pants under the Luvs and Pampers brands; adult incontinence and feminine care products under the Always, Always Discreet, and Tampax brands; and paper towels, tissues, and toilet papers under the Bounty, Charmin, and Puffs brands. The company sells its products primarily through mass merchandisers, e-commerce, grocery stores, membership club stores, drug stores, department stores, distributors, wholesalers, specialty beauty stores, high-frequency stores, pharmacies, electronics stores, and professional channels, as well as directly to consumers. The Procter &amp; Gamble Company was founded in 1837 and is headquartered in Cincinnati, Ohio.","Greene County Bancorp, Inc. operates as a holding company for The Bank of Greene County that provides various financial services in the United States. Its deposit products include savings, NOW accounts, money market accounts, certificates of deposit, non-interest bearing checking accounts, and individual retirement accounts. The company's loan portfolio consists of residential, construction and land, and multifamily mortgage loans; commercial real estate mortgage loans; consumer loans, such as loans on new and used automobiles, personal loans, and home equity loans, as well as other consumer installment loans, including passbook loans, unsecured home improvement loans, recreational vehicle loans, and deposit account overdrafts; and commercial loans. As of June 30, 2021, it operated a network of 17 full-service banking offices. The company was founded in 1889 and is based in Catskill, New York. Greene County Bancorp, Inc. is a subsidiary of Greene County Bancorp, MHC.","AstraZeneca PLC, a biopharmaceutical company, focuses on the discovery, development, manufacturing, and commercialization of prescription medicines. Its marketed products include Calquence, Enhertu, Faslodex, Imfinzi, Iressa, Koselugo, Lumoxiti, Lynparza, Orpathys, Tagrisso, and Zoladex for oncology; Brilinta/Brilique, Bydureon/Byetta, BCise, Byetta, Crestor, Evrenzo, Farxiga/Forxiga, Komboglyze/Kombiglyze XR, Lokelma, Onglyza, Qtern, and Xigduo/Xigduo XR for cardiovascular, renal, and metabolism diseases; Bevespi Aerosphere, Breztri Aerosphere, Daliresp/Daxas, Duaklir Genuair, Fasenra, Pulmicort, Saphnelo, Symbicort, and Tudorza/Eklira/Bretaris for respiratory and immunology; and Andexxa/Ondexxya, Kanuma, Soliris, Strensiq, and Ultomiris for rare diseases. The company's marketed products also comprise Synagis for respiratory syncytial virus; Fluenz Tetra/FluMist Quadrivalent for Influenza; Seroquel IR/Seroquel XR for schizophrenia bipolar disease; Nexium, and Losec/Prilosec for gastroenterology; and Vaxzevria and Evusheld for covid-19. The company serves primary care and specialty care physicians through distributors and local representative offices in the United Kingdom, rest of Europe, the Americas, Asia, Africa, and Australasia. It has a collaboration agreement with Regeneron Pharmaceuticals, Inc. to research, develop, and commercialize small molecule medicines for obesity; Neurimmune AG to develop and commercialize NI006; Ionis Pharmaceuticals, Inc. to develop eplontersen, a liver-targeted antisense therapy in Phase III development for the treatment of transthyretin amyloidosis; Proteros Biostructures GmbH to jointly discover novel small molecules for the treatment of hematological cancers; Sierra Oncology, Inc. to develop and commercialize AZD5153. The company was formerly known as Zeneca Group PLC and changed its name to AstraZeneca PLC in April 1999. AstraZeneca PLC was incorporated in 1992 and is headquartered in Cambridge, the United Kingdom.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","First Merchants Corporation operates as the financial holding company for First Merchants Bank that provides community banking services. It accepts time, savings, and demand deposits; and provides consumer, commercial, agri-business, and real estate mortgage loans, as well as public finance. The company also offers personal and corporate trust; brokerage and private wealth management; and letters of credit, repurchase agreements, and other corporate services. It operates 109 banking locations in Indiana, Illinois, Ohio, and Michigan counties. The company also offers its services through electronic and mobile delivery channels. First Merchants Corporation was founded in 1893 and is headquartered in Muncie, Indiana.","Fulton Financial Corporation operates as a financial holding company that provides consumer and commercial banking products and services. It accepts various checking accounts and savings deposit products, certificates of deposit, and individual retirement accounts. The company also offers secured consumer loans, including home equity loans and lines of credit, automobile loans, personal lines of credit, and checking account overdraft protection; construction and jumbo residential mortgage loans; and commercial lending products comprising commercial real estate, commercial and industrial, and construction loans, as well as equipment lease financing loans. In addition, it provides letters of credit, cash management services, and traditional deposit products; and wealth management services, including investment management, trust, brokerage, insurance, and investment advisory services. Further, the company owns passive investments, as well as trust preferred securities; and sells various life insurance products. It provides its products and services through traditional financial center banking, as well as through a network of automated teller machines, telephone banking, mobile banking, and online banking. The company operated branches in Pennsylvania, Maryland, Delaware, New Jersey, and Virginia. Fulton Financial Corporation was incorporated in 1882 and is headquartered in Lancaster, Pennsylvania.","German American Bancorp, Inc. operates as a bank holding company for German American Bank that provides retail and commercial banking services. The company operates through three segments: Core Banking, Wealth Management Services, and Insurance Operations. The Core Banking segment accepts deposits from the general public; and originates consumer, commercial and agricultural, commercial and agricultural real estate, and residential mortgage loans, as well as sells residential mortgage loans in the secondary market. The Wealth Management segment provides trust, investment advisory, brokerage, and retirement planning services. The Insurance Operations segment offers a range of personal and corporate property and casualty insurance products. As of December 31, 2021, the company operated 77 banking offices in 19 contiguous southern Indiana counties; and 14 counties in Kentucky. German American Bancorp, Inc. was founded in 1910 and is based in Jasper, Indiana.","PC Connection, Inc., together with its subsidiaries, provides various information technology (IT) solutions. The company operates through three segments: Business Solutions, Enterprise Solutions, and Public Sector Solutions. It offers IT products, including computer systems, data center solutions, software and peripheral equipment, networking communications, and other products and accessories, as well as provides services related to design, configuration, and implementation of IT solutions. The company markets its products and services through its websites comprising connection.com, connection.com/enterprise, connection.com/publicsector, and macconnection.com. It serves small to medium-sized businesses (SMBs) that include small office/home office customers; government and educational institutions; and medium-to-large corporate accounts through outbound telemarketing and field sales, and marketing programs targeted to specific customer populations, as well as through digital, web, and print media advertising. The company was founded in 1982 and is headquartered in Merrimack, New Hampshire.","Sysco Corporation, through its subsidiaries, engages in the marketing and distribution of various food and related products primarily to the foodservice or food-away-from-home industry in the United States, Canada, the United Kingdom, France, and internationally. It operates through U.S. Foodservice Operations, International Foodservice Operations, SYGMA, and Other segments. The company distributes frozen foods, such as meats, seafood, fully prepared entr\u00e9es, fruits, vegetables, and desserts; canned and dry foods; fresh meats and seafood; dairy products; beverage products; imported specialties; and fresh produce. It also supplies various non-food items, including paper products comprising disposable napkins, plates, and cups; tableware consisting of China and silverware; cookware, which include pots, pans, and utensils; restaurant and kitchen equipment and supplies; and cleaning supplies. The company serves restaurants, hospitals and nursing homes, schools and colleges, hotels and motels, industrial caterers, and other foodservice venues. As of August 27, 2021, it operated 343 distribution facilities. Sysco Corporation was incorporated in 1969 and is headquartered in Houston, Texas.","Campbell Soup Company, together with its subsidiaries, manufactures and markets food and beverage products the United States and internationally. The company operates through Meals &amp; Beverages and Snacks segments. The Meals &amp; Beverages segment engages in the retail and foodservice businesses in the United States and Canada. This segment provides Campbell's condensed and ready-to-serve soups; Swanson broth and stocks; Pacific Foods broth, soups, and non-dairy beverages; Prego pasta sauces; Pace Mexican sauces; Campbell's gravies, pasta, beans, and dinner sauces; Swanson canned poultry; Plum baby food and snacks; V8 juices and beverages; and Campbell's tomato juice. The Snacks segment retails Pepperidge Farm cookies, crackers, fresh bakery, and frozen products; Milano cookies and Goldfish crackers; and Snyder's of Hanover pretzels, Lance sandwich crackers, Cape Cod and Kettle Brand potato chips, Late July snacks, Snack Factory Pretzel Crisps, Pop Secret popcorn, Emerald nuts, and other snacking products. This segment is also involved in the retail business in Latin America. It sells its products through retail food chains, mass discounters and merchandisers, club stores, convenience stores, drug stores, and dollar stores, as well as e-commerce and other retail, commercial, and non-commercial establishments, and independent contractor distributors. The company was founded in 1869 and is headquartered in Camden, New Jersey.","Bentley Systems, Incorporated, together with its subsidiaries, provides infrastructure engineering software solutions in the Americas, Europe, the Middle East, Africa, and the Asia-Pacific. The company offers open modeling and open simulation applications for infrastructure design integration, which include MicroStation, OpenRoads, OpenRail, OpenPlant, OpenBuildings, OpenBridge, OpenSite, OpenFlows, STAAD and RAM, SACS, MOSES, AutoPIPE, SITEOPS, CUBE, DYNAMEQ, EMME, and LEGION; and geoprofessional applications for modeling and simulation of near and deep subsurface conditions, including Leapfrog, AGS Workbench, GeoStudio, Imago, MX Deposit, Oasis montaj, PLAXIS, and OpenGround. It also provides project delivery systems that support collaboration, work-sharing, and 4D construction modeling for infrastructure project delivery enterprises, such as ProjectWise, ProjectWise Design Review Service, and SYNCHRO; and asset and network performance systems, such as AssetWise ALIM, AssetWise Asset Reliability, AssetWise Enterprise Interoperability, AssetWise 4D Analytics, AssetWise Linear, and Seequent Central. In addition, it offers industry solutions comprising AssetWise Linear SUPERLOAD, AssetWise Linear Analytics, AssetWise Inspections, ContextCapture, OpenCities, OpenUtilities, OpenTower, OpenWindPower, Power Line, SPIDA, OrbitGT, sensemetrics, PlantSight, and WaterSight. The company serves civil, structural, geotechnical, geoscience subsurface engineers, architects, geospatial professionals, city and regional planners, contractors, fabricators, and operations and maintenance engineers. Bentley Systems, Incorporated was incorporated in 1984 and is headquartered in Exton, Pennsylvania.",null,"Steel Connect, Inc., together with its subsidiaries, provides direct marketing and supply chain services in the United States, Mainland China, and internationally. The company provides data-driven marketing solutions, including strategy, data and analytics, response analysis, creative services, lithographic and digital printing, envelope printing and converting, component manufacturing, promotional cards, data processing and hygiene, content and asset management, personalization, lettershop and bindery, and postal optimization and omnichannel marketing campaigns, as well as provides business continuity and disaster recovery services. It also offers product configuration and packaging, kitting, and assembly of components and parts into finished goods; and value-added processes, such as product testing, radio frequency identification tagging, product or service activation, language settings, personalization and engraving, multi-channel packaging, and packaging design services. In addition, the company provides fulfillment services comprising order management, pick, pack and ship, retail compliance, and demand planning services; and reverse logistics services that simplifies the returns process for retailers and manufacturers, as well as operates a cloud-based e-commerce platform. Steel Connect, Inc. offers its supply chain services to customers in the consumer electronics, communications, computing, medical devices, software, and retail markets. The company was formerly known as ModusLink Global Solutions, Inc. and changed its name to Steel Connect, Inc. in February 2018. Steel Connect, Inc. was incorporated in 1986 and is headquartered in Smyrna, Tennessee.","Great Elm Capital Corp. is a business development company which specializes in loan and mezzanine, middle market investments. It invests in the debt instruments of middle market companies. The fund prefers to invest in media, commercial services and supplies, healthcare, telecommunication services, communications equipment. It typically makes equity investments between $3 million and $10 million in companies with revenues between $3 million and $75 million.","DoubleDown Interactive Co., Ltd. engages in the development and publishing of digital games on mobile and web-based platforms for casual players in South Korea. The company offers DoubleDown Casino, DoubleDown Classic, DoubleDown Fort Knox, and Undead World: Hero Survival games. Its games are primarily distributed, marketed, and promoted through third party platform providers. The company was formerly known as The8Games Co., Ltd. and changed its name to DoubleDown Interactive Co., Ltd. in December 2019. The company was incorporated in 2008 and is headquartered in Seoul, South Korea. DoubleDown Interactive Co., Ltd. operates as a subsidiary of DoubleU Games Co., Ltd.","The fund generally invests in the stocks that comprise the S&amp;P 500\u00ae Index in approximately the proportions they are represented in the S&amp;P 500\u00ae Index. Under normal market conditions, at least 95% of the fund's net assets will be invested in the stocks that comprise the S&amp;P 500\u00ae Index. The fund may purchase or sell futures contracts and options on futures contracts for U.S. equity securities and indices, to increase or decrease equity market exposure based on actual or expected cash inflows to or outflows from the Portfolio.","Geospace Technologies Corporation designs and manufactures instruments and equipment used in the oil and gas industry to acquire seismic data in order to locate, characterize, and monitor hydrocarbon producing reservoirs. The company operates through three segments: Oil and Gas Markets, Adjacent Markets, and Emerging Markets. The Oil and Gas Markets segment offers wireless seismic data acquisition systems and reservoir characterization products and services, as well as traditional seismic exploration products, such as geophones, hydrophones, leader wires, connectors, cables, marine streamer retrieval and steering devices, and other seismic products. The Adjacent Markets segment provides industrial products, including imaging equipment, water meter products, remote shut-off valves and Internet of Things platform, and offshore cables, as well as seismic sensors for vibration monitoring and geotechnical applications, such as mine safety and earthquake detection applications; and electronic pre-press products that employ direct thermal imaging, direct-to-screen printing systems, and digital inkjet printing technologies targeted at the commercial and industrial graphics, textile, and flexographic printing industries. The Emerging Markets segment designs and sells products used for border and perimeter security surveillance, cross-border tunneling detection, and other products targeted at movement monitoring, intrusion detection, and situational awareness. This segment serves customers that include various agencies of the United States government, including the Department of Defense, Department of Energy, Department of Homeland Security, and other agencies. The company operates in Asia, Canada, Europe, the United States, and internationally. Geospace Technologies Corporation was founded in 1980 and is headquartered in Houston, Texas.","Akso Health Group operates a social e-commerce mobile platform in China. The company operates Xiaobai Maimai App, which offers food and beverage products, wine, cosmetic products, fashion and apparel, entertainment products, housewares, home appliances, etc. It also offers consultancy and information technology support services; and trades in branded products, as well as promotes products. The company was formerly known as Xiaobai Maimai Inc. and changed its name to Akso Health Group in December 2021. Akso Health Group was founded in 2014 and is headquartered in Beijing, China. As of July 13, 2021, Akso Health Group operates as a subsidiary of Webao Limited.","Camtek Ltd., together with its subsidiaries, develops, manufactures, and sells inspection and metrology equipment for the advanced interconnect packaging, memory, complementary metal oxide semiconductor image sensors, micro-electro mechanical systems, radio frequency, and other segments of the semiconductor industry. It provides inspection and metrology systems, including Eagle-i, a system that delivers 2D inspection and metrology capabilities; Eagle-AP, which addresses the advanced packaging market using software and hardware technologies that deliver superior 2D and 3D inspection and metrology capabilities on the same platform; and Golden Eagle, a panel inspection and metrology system to support fanout wafer level packaging applications. The company sells its products in the Asia Pacific, the United States, and Europe. Camtek Ltd. was incorporated in 1987 and is headquartered in Migdal HaEmek, Israel.","AppLovin Corporation engages in building a software-based platform for mobile app developers to enhance the marketing and monetization of their apps in the United States and internationally. The company's software solutions include AppDiscovery, a marketing software solution, which matches advertiser demand with publisher supply through auctions; Adjust, an analytics platform that helps marketers grow their mobile apps with solutions for measuring, optimizing campaigns, and protecting user data; and MAX, an in-app bidding software that optimizes the value of an app's advertising inventory by running a real-time competitive auction. Its business clients include various advertisers, publishers, internet platforms, and others. The company was incorporated in 2011 and is headquartered in Palo Alto, California.","Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial, and industrial customers and utilities through its website, stores, and galleries, as well as through a network of channel partners; and provision of service and repairs to its energy product customers, including under warranty, as well as various financing options to its solar customers. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was incorporated in 2003 and is headquartered in Austin, Texas.","Freedom Holding Corp., through its subsidiaries, provides retail securities brokerage, research, investment counseling, securities trading, market making, retail banking, corporate investment banking, and underwriting services. The company offers investment brokerage services for exchange-traded and over-the-counter corporate equity and debt securities, money market instruments, exchange traded options and futures contracts, government bonds, and mutual funds; margin lending services collateralized by securities and cash in the customer's account; various investment education and training courses; investment research services; and commercial banking services, including payment cards, digital mortgages, and digital auto loans, as well as insurance products. It also provides capital raising solutions for corporate clients through initial public offerings and follow-on offerings; and debt capital markets solutions that focuses on structuring and distributing private and public debt for various purposes, including buyouts, acquisitions, growth capital financings, and recapitalizations. In addition, the company is involved in trading, investment, and brokerage activities. Further, it facilitates repurchase and reverse repurchase agreements in proprietary trading activities; and covers short positions and settle other securities obligations to accommodate customers' needs and finance its inventory positions. Additionally, the company offers Tradernet software platform for client margin risk evaluation and middle office security transfer requests. It operates in Central Asia, Europe, the United States, Russia, and the Middle East/Caucasus. The company was formerly known as BMB Munai, Inc. and changed its name to Freedom Holding Corp. Freedom Holding Corp. was incorporated in 1981 and is headquartered in Almaty, Kazakhstan.","Freedom Holding Corp., through its subsidiaries, provides retail securities brokerage, research, investment counseling, securities trading, market making, retail banking, corporate investment banking, and underwriting services. The company offers investment brokerage services for exchange-traded and over-the-counter corporate equity and debt securities, money market instruments, exchange traded options and futures contracts, government bonds, and mutual funds; margin lending services collateralized by securities and cash in the customer's account; various investment education and training courses; investment research services; and commercial banking services, including payment cards, digital mortgages, and digital auto loans, as well as insurance products. It also provides capital raising solutions for corporate clients through initial public offerings and follow-on offerings; and debt capital markets solutions that focuses on structuring and distributing private and public debt for various purposes, including buyouts, acquisitions, growth capital financings, and recapitalizations. In addition, the company is involved in trading, investment, and brokerage activities. Further, it facilitates repurchase and reverse repurchase agreements in proprietary trading activities; and covers short positions and settle other securities obligations to accommodate customers' needs and finance its inventory positions. Additionally, the company offers Tradernet software platform for client margin risk evaluation and middle office security transfer requests. It operates in Central Asia, Europe, the United States, Russia, and the Middle East/Caucasus. The company was formerly known as BMB Munai, Inc. and changed its name to Freedom Holding Corp. Freedom Holding Corp. was incorporated in 1981 and is headquartered in Almaty, Kazakhstan.","Freedom Holding Corp., through its subsidiaries, provides retail securities brokerage, research, investment counseling, securities trading, market making, retail banking, corporate investment banking, and underwriting services. The company offers investment brokerage services for exchange-traded and over-the-counter corporate equity and debt securities, money market instruments, exchange traded options and futures contracts, government bonds, and mutual funds; margin lending services collateralized by securities and cash in the customer's account; various investment education and training courses; investment research services; and commercial banking services, including payment cards, digital mortgages, and digital auto loans, as well as insurance products. It also provides capital raising solutions for corporate clients through initial public offerings and follow-on offerings; and debt capital markets solutions that focuses on structuring and distributing private and public debt for various purposes, including buyouts, acquisitions, growth capital financings, and recapitalizations. In addition, the company is involved in trading, investment, and brokerage activities. Further, it facilitates repurchase and reverse repurchase agreements in proprietary trading activities; and covers short positions and settle other securities obligations to accommodate customers' needs and finance its inventory positions. Additionally, the company offers Tradernet software platform for client margin risk evaluation and middle office security transfer requests. It operates in Central Asia, Europe, the United States, Russia, and the Middle East/Caucasus. The company was formerly known as BMB Munai, Inc. and changed its name to Freedom Holding Corp. Freedom Holding Corp. was incorporated in 1981 and is headquartered in Almaty, Kazakhstan.","Freedom Holding Corp., through its subsidiaries, provides retail securities brokerage, research, investment counseling, securities trading, market making, retail banking, corporate investment banking, and underwriting services. The company offers investment brokerage services for exchange-traded and over-the-counter corporate equity and debt securities, money market instruments, exchange traded options and futures contracts, government bonds, and mutual funds; margin lending services collateralized by securities and cash in the customer's account; various investment education and training courses; investment research services; and commercial banking services, including payment cards, digital mortgages, and digital auto loans, as well as insurance products. It also provides capital raising solutions for corporate clients through initial public offerings and follow-on offerings; and debt capital markets solutions that focuses on structuring and distributing private and public debt for various purposes, including buyouts, acquisitions, growth capital financings, and recapitalizations. In addition, the company is involved in trading, investment, and brokerage activities. Further, it facilitates repurchase and reverse repurchase agreements in proprietary trading activities; and covers short positions and settle other securities obligations to accommodate customers' needs and finance its inventory positions. Additionally, the company offers Tradernet software platform for client margin risk evaluation and middle office security transfer requests. It operates in Central Asia, Europe, the United States, Russia, and the Middle East/Caucasus. The company was formerly known as BMB Munai, Inc. and changed its name to Freedom Holding Corp. Freedom Holding Corp. was incorporated in 1981 and is headquartered in Almaty, Kazakhstan.","Lam Research Corporation designs, manufactures, markets, refurbishes, and services semiconductor processing equipment used in the fabrication of integrated circuits. The company offers ALTUS systems to deposit conformal films for tungsten metallization applications; SABRE electrochemical deposition products for copper interconnect transition that offers copper damascene manufacturing; SOLA ultraviolet thermal processing products for film treatments; and VECTOR plasma-enhanced CVD ALD products. It also provides SPEED gapfill high-density plasma chemical vapor deposition products; and Striker single-wafer atomic layer deposition products for dielectric film solutions. In addition, the company offers Flex for dielectric etch applications; Kiyo for conductor etch applications; Syndion for through-silicon via etch applications; and Versys metal products for metal etch processes. Further, it provides Coronus bevel clean products to enhance die yield; Da Vinci, DV-Prime, EOS, and SP series products to address various wafer cleaning applications; and Metryx mass metrology systems for high precision in-line mass measurement in semiconductor wafer manufacturing. The company sells its products and services to semiconductors industry in the United States, China, Europe, Japan, Korea, Southeast Asia, Taiwan, and internationally. Lam Research Corporation was incorporated in 1980 and is headquartered in Fremont, California.","Aehr Test Systems provides test systems for burning-in and testing logic, optical, and memory integrated circuits worldwide. It offers products, such as the ABTS and FOX-P families of test and burn-in systems and FOX WaferPak Aligner, FOX-XP WaferPak Contactor, FOX DiePak Carrier, and FOX DiePak Loader. The ABTS system is used in production and qualification testing of packaged parts for lower power and higher power logic devices, as well as various common types of memory devices. The FOX-XP and FOX-NP systems are wafer contact and singulated die/module test and burn-in systems used for burn-in and functional test of complex devices, such as memories, digital signal processors, microprocessors, microcontrollers, systems-on-a-chip, and integrated optical devices. The FOX-CP system is a single-wafer compact test and reliability verification solution for logic, memory, and photonic devices. The WaferPak Contactor contains a unique full wafer probe card capable of testing wafers up to 300mm that enables IC manufacturers to perform test and burn-in of full wafers on Aehr Test FOX systems. The DiePak Carrier is a reusable, temporary package that enables IC manufacturers to perform final test and burn-in of bare die and modules. Aehr Test Systems was incorporated in 1977 and is headquartered in Fremont, California.","Energy Services of America Corporation provides contracting services for utilities and energy related companies in the United States. It constructs, replaces, and repairs interstate and intrastate natural gas pipelines and storage facilities for utility companies and private natural gas companies; and provides services relating to pipeline, storage facilities, and plant works. The company also offers a range of electrical and mechanical installation, and repair services, including substation and switchyard, site preparation, equipment setting, pipe fabrication and installation, packaged buildings, transformers, and other ancillary works for the gas, petroleum power, chemical, water and sewer, and automotive industries. It provides liquid pipeline and pump station construction, production facility construction, water and sewer pipeline installation, and various maintenance and repair services, as well as other services related to pipeline construction. The company serves customers primarily in West Virginia, Virginia, Ohio, Pennsylvania, and Kentucky. Energy Services of America Corporation was incorporated in 2006 and is based in Huntington, West Virginia.","Extreme Networks, Inc. provides software-driven networking solutions worldwide. It designs, develops, and manufactures wired and wireless network infrastructure equipment; and develops software for network management, policy, analytics, security, and access controls. The company offers ExtremeCloud IQ, an ML/AI powered, wired, and wireless cloud network management solution that offers advanced visibility and control over users, devices, and applications; ExtremeCloud IQ \u0096 Site Engine that provides task automation, access control, granular visibility with real-time analytics and multi-vendor device management; and ExtremeCloud IQ Essentials offers WIPS, location services, IoT, and guest management services. It also provides wireless access point products; ExtremeSwitching portfolio that includes access edge products that offer physical presentations along with options to deliver Ethernet or convergence-friendly Power-over-Ethernet (POE), including high-power universal POE; aggregation/core switches designed to address aggregation, top-of-rack, and campus core environments; and data center switches and routers. In addition, the company offers cloud native platforms and applications for service providers; and customer support and services. It markets and sells its products through distributors, resellers, and field sales organizations to healthcare, education, government, manufacturing, retail, and hospitality markets. Extreme Networks, Inc. was incorporated in 1996 and is headquartered in Morrisville, North Carolina.","Jabil Inc. provides manufacturing services and solutions worldwide. The company operates in two segments, Electronics Manufacturing Services and Diversified Manufacturing Services. It offers electronics design, production, and product management services. The company provides electronic design services, such as application-specific integrated circuit design, firmware development, and rapid prototyping services; and designs plastic and metal enclosures that include the electro-mechanics, such as the printed circuit board assemblies (PCBA). It also specializes in the three-dimensional mechanical design comprising the analysis of electronic, electro-mechanical, and optical assemblies, as well as offers various industrial design, mechanism development, and tooling management services. In addition, the company provides computer-assisted design services consisting of PCBA design, as well as PCBA design validation and verification services; and other consulting services, such as the generation of a bill of materials, approved vendor list, and assembly equipment configuration for various PCBA designs. Further, it offers product and process validation services, such as product system, product safety, regulatory compliance, and reliability tests, as well as manufacturing test solution development services. Additionally, the company provides systems assembly, test, direct-order fulfillment, and configure-to-order services. It serves 5G, wireless and cloud, digital print and retail, industrial and semi-cap, networking and storage, automotive and transportation, connected devices, healthcare and packaging, and mobility industries. The company was formerly known as Jabil Circuit, Inc. and changed its name to Jabil Inc. in June 2017. Jabil Inc. was founded in 1966 and is headquartered in Saint Petersburg, Florida.","Applied Materials, Inc. provides manufacturing equipment, services, and software to the semiconductor, display, and related industries. It operates through three segments: Semiconductor Systems, Applied Global Services, and Display and Adjacent Markets. The Semiconductor Systems segment develops, manufactures, and sells various manufacturing equipment that is used to fabricate semiconductor chips or integrated circuits. This segment also offers various technologies, including epitaxy, ion implantation, oxidation/nitridation, rapid thermal processing, physical vapor deposition, chemical vapor deposition, chemical mechanical planarization, electrochemical deposition, atomic layer deposition, etching, and selective deposition and removal, as well as metrology and inspection tools. The Applied Global Services segment provides integrated solutions to optimize equipment and fab performance and productivity comprising spares, upgrades, services, remanufactured earlier generation equipment, and factory automation software for semiconductor, display, and other products. The Display and Adjacent Markets segment offers products for manufacturing liquid crystal displays; organic light-emitting diodes; and other display technologies for TVs, monitors, laptops, personal computers, electronic tablets, smart phones, and other consumer-oriented devices. The company operates in the United States, China, Korea, Taiwan, Japan, Southeast Asia, and Europe. Applied Materials, Inc. was incorporated in 1967 and is headquartered in Santa Clara, California.","Broadcom Inc. designs, develops, and supplies various semiconductor devices with a focus on complex digital and mixed signal complementary metal oxide semiconductor based devices and analog III-V based products worldwide. The company operates in two segments, Semiconductor Solutions and Infrastructure Software. It provides set-top box system-on-chips (SoCs); cable, digital subscriber line, and passive optical networking central office/consumer premise equipment SoCs; wireless local area network access point SoCs; Ethernet switching and routing merchant silicon products; embedded processors and controllers; serializer/deserializer application specific integrated circuits; optical and copper, and physical layers; and fiber optic transmitter and receiver components. The company also offers RF front end modules, filters, and power amplifiers; Wi-Fi, Bluetooth, and global positioning system/global navigation satellite system SoCs; custom touch controllers; serial attached small computer system interface, and redundant array of independent disks controllers and adapters; peripheral component interconnect express switches; fiber channel host bus adapters; read channel based SoCs; custom flash controllers; preamplifiers; and optocouplers, industrial fiber optics, and motion control encoders and subsystems. Its products are used in various applications, including enterprise and data center networking, home connectivity, set-top boxes, broadband access, telecommunication equipment, smartphones and base stations, data center servers and storage systems, factory automation, power generation and alternative energy systems, and electronic displays. Broadcom Inc. was incorporated in 2018 and is headquartered in San Jose, California.","Bruker Corporation develops, manufactures, and distributes scientific instruments, and analytical and diagnostic solutions in the United States and internationally. The company operates through three segments: Bruker Scientific Instruments (BSI) Life Science, BSI NANO, and Bruker Energy &amp; Supercon Technologies. It offers life science tools, and single and multiple modality systems; life science mass spectrometry; MALDI Biotyper rapid pathogen identification platform and related test kits, DNA test strips, and fluorescence-based polymerase chain reaction technology; genotype and fluorotype molecular diagnostics kits; research, analytical, and process analysis instruments and solutions; SARS-CoV 2 testing for the diagnosis of COVID-19 infection; and Fluorotyper-SARS-CoV 2 plus kits. It also provides range of portable analytical and bioanalytical detection systems, and related products; X-ray instruments; analytical tools for electron microscopes, as well as handheld, portable, and mobile X-ray fluorescence spectrometry instruments; atomic force microscopy instrumentation; non-contact nanometer resolution solution topography; and automated X-ray metrology, automated AFM defect-detection, and photomask repair and cleaning equipment. In addition, the company offers advanced optical fluorescence microscopy instruments; products and services to support the multi-omics needs of researchers in translational research, drug, and biomarker discovery; superconducting materials, such as metallic low temperature superconductors; devices and complex tools based on metallic low temperature superconductors; and non-superconducting high technology tools, such as synchrotron and beamline instrumentation. Bruker Corporation has a collaboration with Newomics Inc. on a LC-MS platform for drug discovery. The company was incorporated in 1991 and is headquartered in Billerica, Massachusetts.","Eltek Ltd. manufactures, markets, and sells printed circuit boards (PCBs) in Israel, Europe, North America, India, the Netherlands, and internationally. The company offers a range of custom designed PCBs, including rigid, double-sided, and multi-layer PCBs, and flexible circuitry boards. It also offers high density interconnect, flex-rigid, and multi-layered boards. It primarily serves manufacturers of defense and aerospace, medical, industrial, telecom, and networking equipment, as well as contract electronic manufacturers and others. The company markets and sells its products primarily through direct sales personnel, sales representatives, and PCB trading and manufacturing companies. Eltek Ltd. was incorporated in 1970 and is headquartered in Petach Tikva, Israel. Eltek Ltd. is a subsidiary of Nistec Golan Ltd.","Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple TV, Apple Watch, Beats products, and HomePod. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts. In addition, the company offers various services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV+, which offers exclusive original content; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers, wholesalers, retailers, and resellers. Apple Inc. was incorporated in 1977 and is headquartered in Cupertino, California.","KLA Corporation designs, manufactures, and markets process control, process-enabling, and yield management solutions for the semiconductor and related electronics industries worldwide. It operates through four segments: Semiconductor Process Control; Specialty Semiconductor Process; PCB, Display and Component Inspection; and Other. The company offers integrated circuit (IC) manufacturing products that comprises wafer inspection and review, and metrology; wafer and substrate defect inspection and metrology; reticle defect inspection and metrology; chemical/materials quality analysis; in situ process management and wafer handling diagnostics for IC and original equipment manufacturer (OEM) manufacturing; software products to provide run-time process control, defect excursion identification, process corrections, and defect classification; and refurbished and remanufactured products. It also provides specialty semiconductor manufacturing, benchtop metrology, surface characterization, and electrical property measurement services for general purpose/ lab applications; etch, plasma dicing, deposition, and other wafer processing technologies and solutions for the semiconductor and microelectronics industry. In addition, the company offers direct imaging, inspection, optical shaping, additive printing, and computer-aided manufacturing and engineering solutions for the PCB market; inspection and electrical testing systems to identify and classify defects, as well as systems to repair defects for the display market; and inspection and metrology systems for quality control and yield improvement in advanced and traditional semiconductor packaging markets. The company was formerly known as KLA-Tencor Corporation and changed its name to KLA Corporation in July 2019. KLA Corporation was incorporated in 1975 and is headquartered in Milpitas, California.","D.R. Horton, Inc. operates as a homebuilding company in East, North, Southeast, South Central, Southwest, and Northwest regions in the United States. It engages in the acquisition and development of land; and construction and sale of residential homes in 31 states and 98 markets under the names of D.R. Horton, America's Builder, Express Homes, Emerald Homes, and Freedom Homes. The company constructs and sells single-family detached homes; and attached homes, such as town homes, duplexes, and triplexes. It also provides mortgage financing services; and title insurance policies, and examination and closing services, as well as engages in the residential lot development business. In addition, the company develops, constructs, owns, leases, and sells multi-family and single-family rental properties; owns non-residential real estate, including ranch land and improvements; and owns and operates energy related assets. It primarily serves homebuyers. D.R. Horton, Inc. was founded in 1978 and is headquartered in Arlington, Texas.","Cross Country Healthcare, Inc. provides talent management and other consultative services for healthcare clients in the United States. The company operates in two segments, Nurse and Allied Staffing and Physician Staffing. The Nurse and Allied Staffing segment offers traditional staffing, including temporary and permanent placement of travel nurses and allied professionals, local nurses, and allied staffing; staffing solutions for registered nurses, licensed practical nurses, certified nurse assistants, practitioners, pharmacists, and other allied professionals on per diem and short-term assignments; and clinical and non-clinical professionals on long-term contract assignments, as well as workforce solutions, including MSP, RPO, and consulting services. It also provides retained search services for healthcare professionals, as well as contingent search and recruitment process outsourcing services. This segment serves public and private acute care and non-acute care hospitals, government facilities, local and national healthcare plans, managed care providers, public and charter schools, outpatient clinics, ambulatory care facilities, physician practice groups, and other healthcare providers under the Cross Country brand. The Physician Staffing segment provides physicians in various specialties, certified registered nurse anesthetists, nurse practitioners, and physician assistants under the Cross Country Locums brand as independent contractors on temporary assignments at various healthcare facilities, such as acute and non-acute care facilities, medical group practices, government facilities, and managed care organizations. The company was founded in 1986 and is headquartered in Boca Raton, Florida.","Accenture plc, a professional services company, provides strategy and consulting, interactive, and technology and operations services worldwide. The company offers application services, including agile transformation, DevOps, application modernization, enterprise architecture, software and quality engineering, data management, intelligent automation comprises robotic process automation, natural language processing, and virtual agents, and liquid application management services, as well as program, project, and service management services; strategy consulting services; critical data elements, data management and governance, data platform and architecture, product-based organization and skills, business adoption, and value realization services; engineering, and research and development digitization; smart connected product design and development; product platform engineering and modernization; product as-a-service enablement; products related to production and operations; autonomous robotics systems; the digital transformation of capital projects; and digital industrial workforce solutions. It also provides data-enabled operating models; technology consulting and artificial intelligence services; services related to talent and organization/human potential; digital commerce; infrastructure services, such as hybrid cloud, network, digital workplace and collaboration, service and experience management, infrastructure as code, and managed edge and IoT devices; cyber defense, applied cybersecurity, managed security, OT security, security strategy and risk, and industry security products; services related to technology innovation; and intelligent automation services. In addition, the company offers cloud, ecosystem, marketing, supply chain management, zero-based budgeting, customer experience, finance consulting, mergers and acquisitions, and sustainability services. Accenture plc was founded in 1951 and is based in Dublin, Ireland.","Netflix, Inc. provides entertainment services. It offers TV series, documentaries, feature films, and mobile games across various genres and languages. The company provides members the ability to receive streaming content through a host of internet-connected devices, including TVs, digital video players, television set-top boxes, and mobile devices. It also provides DVDs-by-mail membership services in the United States. The company has approximately 222 million paid members in 190 countries. Netflix, Inc. was incorporated in 1997 and is headquartered in Los Gatos, California.","Golden Entertainment, Inc., together with its subsidiaries, engages in the ownership and operation of a diversified entertainment platform in the United States. The company operates through four segments: Nevada Casino Resorts, Nevada Locals Casinos, Maryland Casino Resort, and Distributed Gaming. The Nevada Casino Resorts segment comprises of destination casino resort properties that include various food and beverage outlets, entertainment venues, and other amenities. The Nevada Locals Casinos segment consists of casino properties that cater to local customers. The Maryland Casino Resort segment operates Rocky Gap casino resort, including various food and beverage outlets, signature golf course, spa, and pool. The Distributed Gaming segment operates slot machines and amusement devices in non-casino locations, such as restaurants, bars, taverns, convenience stores, liquor stores, and grocery stores. As of February 17, 2022, the company operated approximately 16,900 slots, 120 table games, and 6,200 hotel rooms; 10 casinos; and video gaming devices at 1,100 locations, as well as owned 60 traditional taverns. The company was formerly known as Lakes Entertainment, Inc. and changed its name to Golden Entertainment, Inc. in July 2015. Golden Entertainment, Inc. was incorporated in 1998 and is headquartered in Las Vegas, Nevada.","Five Below, Inc. operates as a specialty value retailer in the United States. It offers accessories, including socks, sunglasses, jewelry, scarves, gloves, hair accessories, athletic tops and bottoms, and t-shirts, as well as nail polishes, lip glosses, fragrances, and branded cosmetics; and items used to complete and personalize living space, such as glitter lamps, posters, frames, fleece blankets, plush items, pillows, candles, incense, lighting, novelty d\u00e9cor, accent furniture, and related items, as well as provides storage options for the customers room. The company also provides sport balls; team sports merchandise and fitness accessories, such as hand weights, jump ropes, and gym balls; games, including name brand board games, puzzles, collectibles, and toys covering remote control; and pool, beach, and outdoor toys, as well as games and accessories. In addition, it offers accessories for cell phones, tablets, audio, and computers, such as cases, chargers, headphones, and other items; books, video games, and DVDs; craft activity kits; arts and crafts supplies, such as crayons, markers, and stickers; and trend-right items for school comprising backpacks, fashion notebooks and journals, novelty pens and pencils, locker accessories, and everyday name brand items. Further, the company provides party goods, decorations, gag gifts, and greeting cards, as well as every day and special occasion merchandise products; assortment of classic and novelty candy bars, movie-size box candy, seasonal-related candy, and gum and snack food; chilled drinks through coolers; and seasonally-specific items used to celebrate and decorate for events. It primarily serves tween and teen customers. As of January 29, 2022, the company operated approximately 1,190 stores in 40 states. The company was formerly known as Cheap Holdings, Inc. and changed its name to Five Below, Inc. in August 2002. Five Below, Inc. was incorporated in 2002 and is headquartered in Philadelphia, Pennsylvania.","Allegro MicroSystems, Inc. designs, develops, manufactures, and markets sensor integrated circuits (ICs) and application-specific analog power ICs for motion control and energy-efficient systems. Its products include magnetic sensor ICs, such as position, speed, and current sensor ICs; power ICs comprising motor driver ICs, and regulator and LED driver ICs; and photonic and 3D sensing components, including photodiodes, eye-safe lasers, and readout ICs for LiDAR applications. The company sells its products to original equipment manufacturers and suppliers primarily in the automotive and industrial markets through its direct sales force, third party distributors, independent sales representatives, and consignment. It operates in the United States, rest of the Americas, Europe, Japan, Greater China, South Korea, and other Asian markets. The company was founded in 1990 and is headquartered in Manchester, New Hampshire. Allegro MicroSystems, Inc. is a subsidiary of Sanken Electric Co., Ltd.","Teradyne, Inc. designs, develops, manufactures, sells, and supports automatic test equipment worldwide. The company operates through Semiconductor Test, System Test, Industrial Automation, and Wireless Test segments. The Semiconductor Test segment offers products and services for wafer level and device package testing in automotive, industrial, communications, consumer, smartphones, cloud computer and electronic game, and other applications. This segment also provides FLEX test platform systems; J750 test system to address the volume semiconductor devices; Magnum platform that tests memory devices, such as flash memory and DRAM; and ETS platform for semiconductor manufacturers, and assembly and test subcontractors in the analog/mixed signal markets. It serves integrated device manufacturers that integrate the fabrication of silicon wafers into their business; fabless companies that outsource the manufacturing of silicon wafers; foundries; and semiconductor assembly and test providers. The System Test segment offers defense/aerospace test instrumentation and systems; storage test systems; and circuit-board test and inspection systems. The Industrial Automation segment provides collaborative robotic arms, autonomous mobile robots, and advanced robotic control software for manufacturing, logistics, and light industrial customers. The Wireless Test segment provides test solutions for use in the development and manufacture of wireless devices and modules, smartphones, tablets, notebooks, laptops, peripherals, and Internet-of-Things devices under the LitePoint brand name. This segment also offers IQxel products for Wi-Fi and other standards; IQxstream solution for testing GSM, EDGE, CDMA2000, TD-SCDMA, WCDMA, HSPA+, LTE, and 5G technologies; IQcell, a multi-device cellular signaling test solution; IQgig test solution; and turnkey test software for wireless chipsets. Teradyne, Inc. was incorporated in 1960 and is headquartered in North Reading, Massachusetts.","Gambling.com Group Limited operates as a performance marketing company for the online gambling industry worldwide. The company provides digital marketing services for the iGaming and sports betting. It publishes various branded websites, including Gambling.com and Bookies.com. Gambling.com Group Limited was incorporated in 2006 and is based in St. Helier, Jersey.","Concrete Pumping Holdings, Inc. provides concrete pumping and waste management services in the United States and the United Kingdom. The company offers concrete pumping services to general contractors and concrete finishing companies in the commercial, infrastructure, and residential sectors under the Brundage-Bone and Camfaud brands; and industrial cleanup and containment services primarily to customers in the construction industry under the Eco-Pan brand. It also leases and rents concrete pumping equipment, pans, and containers. As of October 31, 2021, the company owned a fleet of approximately 820 boom pumps, 70 placing booms, 20 telebelts, 250 stationary pumps, and 90 waste management trucks. Concrete Pumping Holdings, Inc. was founded in 1983 and is headquartered in Thornton, Colorado.","Chuy's Holdings, Inc., through its subsidiaries, owns and operates full-service restaurants under the Chuy's name in the United States. As of December 26, 2021, it operated 96 restaurants in 17 states, including the Southeastern and Midwestern United States. The company was founded in 1982 and is headquartered in Austin, Texas.","Starbucks Corporation, together with its subsidiaries, operates as a roaster, marketer, and retailer of specialty coffee worldwide. The company operates through three segments: North America, International, and Channel Development. Its stores offer coffee and tea beverages, roasted whole beans and ground coffees, single serve products, and ready-to-drink beverages; and various food products, such as pastries, b
