reakfast sandwiches, and lunch items. The company also licenses its trademarks through licensed stores, and grocery and foodservice accounts. The company offers its products under the Starbucks, Teavana, Seattle's Best Coffee, Evolution Fresh, Ethos, Starbucks Reserve, and Princi brands. As of October 3, 2021, it operated 16,826 company-operated and licensed stores in North America; and 17,007 company-operated and licensed stores internationally. The company was founded in 1971 and is based in Seattle, Washington.","CSG Systems International, Inc. provides revenue management and digital monetization, customer engagement, and payment solutions primarily to the communications industry in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. It offers Advanced Convergent Platform, a private SaaS based platform; related solutions, including field force automation, analytics, electronic bill presentment, ACH, etc. to the North American cable and satellite markets. The company also provides managed services; and professional services to implement, configure, and maintain its solutions, as well as licenses various solutions, such as mediation, partner management, rating, and charging. It serves retail, financial services, healthcare, insurance, and government entities. The company was incorporated in 1994 and is headquartered in Greenwood Village, Colorado.","Adobe Inc. operates as a diversified software company worldwide. It operates through three segments: Digital Media, Digital Experience, and Publishing and Advertising. The Digital Media segment offers products, services, and solutions that enable individuals, teams, and enterprises to create, publish, and promote content; and Document Cloud, a unified cloud-based document services platform. Its flagship product is Creative Cloud, a subscription service that allows members to access its creative products. This segment serves content creators, workers, marketers, educators, enthusiasts, communicators, and consumers. The Digital Experience segment provides an integrated platform and set of applications and services that enable brands and businesses to create, manage, execute, measure, monetize, and optimize customer experiences from analytics to commerce. This segment serves marketers, advertisers, agencies, publishers, merchandisers, merchants, web analysts, data scientists, developers, and executives across the C-suite. The Publishing and Advertising segment offers products and services, such as e-learning solutions, technical document publishing, web conferencing, document and forms platform, web application development, and high-end printing, as well as Advertising Cloud offerings. The company offers its products and services directly to enterprise customers through its sales force and local field offices, as well as to end users through app stores and through its website at adobe.com. It also distributes products and services through a network of distributors, value-added resellers, systems integrators, software vendors and developers, retailers, and original equipment manufacturers. The company was formerly known as Adobe Systems Incorporated and changed its name to Adobe Inc. in October 2018. Adobe Inc. was founded in 1982 and is headquartered in San Jose, California.","Diamond Hill Investment Group, Inc., through its subsidiary, Diamond Hill Capital Management, Inc., provides investment advisory and fund administration services in the United States. It sponsors, distributes, and offers investment advisory and related services to its clients through pooled investment vehicles, including the Diamond Hill Funds, separately managed accounts, and model delivery programs. The company also provides fund administration services, including portfolio and regulatory compliance, treasury and financial oversight, and general business management and governance of the mutual fund complex, as well as oversight of back-office service providers, such as the custodian, fund accountant, and transfer agent. The company was founded in 1990 and is based in Columbus, Ohio.","CPS Technologies Corporation produces and sells advanced material solutions to the transportation, automotive, energy, computing/internet, telecommunication, aerospace, defense, and oil and gas markets. It primarily offers metal matrix composites that are a combination of metal and ceramic, such as baseplates for various applications, including motor controllers used in electric trains, subway cars, wind turbines, and hybrid and electric vehicles; hermetic packages for use in radar, satellite, and avionics applications; baseplates and housings used in modules built with wide band gap semiconductors; and lids and heatspreaders used with integrated circuits for use in internet switches and routers. The company also assembles housings and packages for hybrid circuits. It primarily sells its products to microelectronics systems companies in the United States, Europe, and Asia. The company was formerly known as Ceramics Process Systems Corporation and changed its name to CPS Technologies Corporation in March 2007. CPS Technologies Corporation was incorporated in 1984 and is headquartered in Norton, Massachusetts.","Diodes Incorporated designs, manufactures, and supplies application-specific standard products in the discrete, logic, analog, and mixed-signal semiconductor markets worldwide. It focuses on low pin count semiconductor devices with one or more active or passive components. The company offers discrete semiconductor products, such as MOSFET, TVS, and performance Schottky rectifiers; GPP bridges and retifiers, and performance Schottky diodes; Zener and performance Zener diodes, including tight tolerance and low operating current type; standard, fast, super-fast, and ultra-fast recovery rectifiers; bridge rectifiers; switching diodes; small signal bipolar and prebiased transistors; thyristor surge protection devices; and transient voltage suppressors. It also provides analog products, such as power management devices comprising AC-DC and DC-DC converters, USB power switches, and low dropout and linear voltage regulators; linear devices, such as operational amplifiers and comparators, current monitors, voltage references, and reset generators; LED lighting drivers; audio amplifiers; and sensor products, including hall-effect sensors and motor drivers. The company offers mixed-signal products, such as high speed mux/demux products, digital switches, interfaces, redrivers, universal level shifters/voltage translator, clock ICs, and packet switches; standard logic products comprising low-voltage complementary metal\u0096oxide\u0096semiconductor (CMOS) and high-speed CMOS devices; ultra-low power CMOS logic products and analog switches; multichip products and co-packaged discrete, analog, and mixed-signal silicon in miniature packages; silicon and silicon epitaxial wafers; and crystals and oscillators. It sells its products to the consumer electronics, computing, communications, industrial, and automotive markets through direct sales, marketing personnel, independent sales representatives, and distributors. The company was incorporated in 1959 and is headquartered in Plano, Texas.","Skyworks Solutions, Inc., together with its subsidiaries, designs, develops, manufactures, and markets proprietary semiconductor products, including intellectual property in the United States, China, South Korea, Taiwan, Europe, the Middle East, Africa, and rest of Asia-Pacific. Its product portfolio includes amplifiers, antenna tuners, attenuators, automotive tuners and digital radios, circulators/isolators, DC/DC converters, demodulators, detectors, diodes, wireless analog system on chip products, directional couplers, diversity receive modules, filters, front-end modules, hybrids, light emitting diode drivers, low noise amplifiers, mixers, modulators, optocouplers/optoisolators, phase locked loops, phase shifters, power dividers/combiners, receivers, switches, synthesizers, timing devices, technical ceramics, voltage controlled oscillators/synthesizers, and voltage regulators. The company provides its products for use in the aerospace, automotive, broadband, cellular infrastructure, connected home, entertainment and gaming, industrial, medical, military, smartphone, tablet, and wearable markets. It sells its products through direct sales force, electronic component distributors, and independent sales representatives. The company was incorporated in 1962 and is headquartered in Irvine, California.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. It provides infrastructure platforms, including networking technologies of switching, routing, wireless, and data center products that are designed to work together to deliver networking capabilities, and transport and/or store data. The company also offers collaboration products comprising unified communications, Cisco TelePresence, and conferencing, as well as the Internet of Things and analytics software. In addition, it provides security products, such as network security, cloud and email security, identity and access management, advanced threat protection, and unified threat management products. Further, the company offers a range of service and support options for its customers, including technical support and advanced services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","Rockwell Automation, Inc. provides industrial automation and digital transformation solutions in the United States and internationally. The company operates in three segments, Intelligent Devices, Software &amp; Control, and Lifecycle Services. Its solutions include hardware and software products, and services. The Intelligent Devices segment offers drives, motion, safety, sensing, industrial components, and configured-to-order products. The Software &amp; Control segment provides control and visualization software and hardware, information software, digital twin and simulation software, and network and security infrastructure solutions. The Lifecycle Services segment provides consulting, professional services and solutions, and connected and maintenance services. The company sells its solutions primarily through independent distributors in relation with its direct sales force. It serves discrete end markets, including automotive, semiconductor, warehousing and logistics, and other discrete markets, as well as general industries comprising printing and publishing, marine, glass, fiber and textiles, airports, and aerospace; hybrid end markets, such as food and beverage, life sciences, household and personal care, and tire, as well as eco industrial, including water/wastewater, waste management, mass transit, and renewable energy; and process end markets comprising oil and gas, mining, metals, chemicals, pulp and paper, and others. Rockwell Automation, Inc. was founded in 1903 and is headquartered in Milwaukee, Wisconsin.","Energy Recovery, Inc., together with its subsidiaries, designs, manufactures, and sells various solutions for the seawater reverse osmosis desalination and industrial wastewater treatment industries worldwide. The company operates through Water and Emerging Technologies segments. It offers a suite of products, including energy recovery devices, and high-pressure feed and recirculation pumps; hydraulic turbochargers and boosters; and spare parts, as well as repair, field, and commissioning services. The company also offers a solution to reduce energy consumption in natural gas processing and in refrigeration systems that use carbon dioxide. It provides its products under the ERI, Ultra PX, PX, Pressure Exchanger, PX Pressure Exchanger, PX PowerTrain, VorTeq, IsoBoost, AT, and AquaBold names to large engineering, procurement, and construction firms; end-users and industry consultants; original equipment manufacturers; and aftermarket customers. The company was incorporated in 1992 and is headquartered in San Leandro, California.","Five Star Bancorp operates as the bank holding company for Five Star Bank that provides a range of banking products and services to small and medium-sized businesses, professionals, and individuals. The company accepts various deposits, such as money market, noninterest-bearing and interest checking accounts, savings accounts, and time deposits. Its loan products include commercial and residential real estate loans; commercial loans; commercial land loans; farmland loans; commercial and residential construction loans; and consumer and other loans. The company also offers debit cards; and remote deposit capture, online and mobile banking, and direct deposit services. It operates through seven branch offices and two loan production offices in Northern California. Five Star Bancorp was founded in 1999 and is headquartered in Rancho Cordova, California.","Five Star Bancorp operates as the bank holding company for Five Star Bank that provides a range of banking products and services to small and medium-sized businesses, professionals, and individuals. The company accepts various deposits, such as money market, noninterest-bearing and interest checking accounts, savings accounts, and time deposits. Its loan products include commercial and residential real estate loans; commercial loans; commercial land loans; farmland loans; commercial and residential construction loans; and consumer and other loans. The company also offers debit cards; and remote deposit capture, online and mobile banking, and direct deposit services. It operates through seven branch offices and two loan production offices in Northern California. Five Star Bancorp was founded in 1999 and is headquartered in Rancho Cordova, California.","Five Star Bancorp operates as the bank holding company for Five Star Bank that provides a range of banking products and services to small and medium-sized businesses, professionals, and individuals. The company accepts various deposits, such as money market, noninterest-bearing and interest checking accounts, savings accounts, and time deposits. Its loan products include commercial and residential real estate loans; commercial loans; commercial land loans; farmland loans; commercial and residential construction loans; and consumer and other loans. The company also offers debit cards; and remote deposit capture, online and mobile banking, and direct deposit services. It operates through seven branch offices and two loan production offices in Northern California. Five Star Bancorp was founded in 1999 and is headquartered in Rancho Cordova, California.","Five Star Bancorp operates as the bank holding company for Five Star Bank that provides a range of banking products and services to small and medium-sized businesses, professionals, and individuals. The company accepts various deposits, such as money market, noninterest-bearing and interest checking accounts, savings accounts, and time deposits. Its loan products include commercial and residential real estate loans; commercial loans; commercial land loans; farmland loans; commercial and residential construction loans; and consumer and other loans. The company also offers debit cards; and remote deposit capture, online and mobile banking, and direct deposit services. It operates through seven branch offices and two loan production offices in Northern California. Five Star Bancorp was founded in 1999 and is headquartered in Rancho Cordova, California.","Robert Half International Inc. provides staffing and risk consulting services in North America, South America, Europe, Asia, and Australia. The company operates through three segments: Temporary and Consultant Staffing, Permanent Placement Staffing, and Risk Consulting and Internal Audit Services. It places temporary services for accounting, finance, and bookkeeping; temporary and full-time office and administrative personnel consisting of executive and administrative assistants, receptionists, and customer service representatives; full-time accounting, financial, tax, and accounting operations personnel; and information technology contract professionals and full-time employees in the areas of platform systems integration to end-user technical and desktop support, including specialists in application development, networking and cloud, systems integration and deployment, database design and administration, and security and business continuity. The company also offers temporary and full-time employees in attorney, paralegal, legal administrative, and legal secretarial positions; and senior-level project professionals in the accounting and finance fields for financial systems conversions, expansion into new markets, business process re-engineering, business systems performance improvement, and post-merger financial consolidation. It is involved in serving professionals in the areas of creative, design, marketing, advertising, and public relations; and placing various positions, such as creative directors, graphics designers, web designers, media buyers, front end developers, copywriters, digital marketing managers, marketing analytics specialists, brand managers, and public relations specialists. The company provides internal audit, technology consulting, risk and compliance consulting, and business performance services. It serves clients and employment candidates. Robert Half International Inc. was founded in 1948 and is headquartered in Menlo Park, California.","FactSet Research Systems Inc., a financial data and analytics company, provides integrated financial information and analytical applications to the investment community in the Americas, Europe, the Middle East, Africa, and the Asia Pacific. The company delivers insight and information through the workflow solutions of research, analytics and trading, content and technology solutions, and wealth. It serves portfolio managers, investment banks, asset managers, wealth advisors, corporate clients, and other financial services entities. FactSet Research Systems Inc. was founded in 1978 and is headquartered in Norwalk, Connecticut.","CHS Inc., an integrated agricultural company, provides grains, foods, and energy resources to businesses and consumers in North America, South America, Europe, the Middle East, Africa, and the Asia Pacific. The company operates through four segments: Energy, Ag, Nitrogen Production, and Foods. It is involved in the operation of petroleum refineries and pipelines; supply, marketing, and distribution of refined fuels, including gasoline, diesel fuel, and other energy products; blending, sale, and distribution of lubricants; and the supply of propane and other natural gas liquids. The company also processes and sells crude oil into refined petroleum products under the Cenex brand name to member cooperatives and other independent retailers through a network of approximately 1,500 sites; and provides transportation services. In addition, it markets grains and oilseeds; and offers seeds, crop nutrients, crop protection products, animal feed, animal health products, refined and renewable fuels, and propane, as well as refined oils, meal, soy flour, and processed sunflower products. Further, the company produces and sells nitrogen-based products, including methanol, UAN and urea, and related products; manufactures, packages, and distributes vegetable oil-based products, such as packaged oils, margarine, mayonnaise, flavored dressings, sauces, and other food products; and offers cooperatives with various loans that meet commercial agriculture needs and loans to individual producers, as well as consulting and commodity risk management services. CHS Inc. was incorporated in 1936 and is headquartered in Inver Grove Heights, Minnesota.","Amcor plc develops, produces, and sells packaging products in Europe, North America, Latin America, Africa, and the Asia Pacific regions. The company operates through two segments, Flexibles and Rigid Packaging. The Flexibles segment provides flexible and film packaging products in the food and beverage, medical and pharmaceutical, fresh produce, snack food, personal care, and other industries. The Rigid Packaging segment offers rigid containers for a range of beverage and food products, including carbonated soft drinks, water, juices, sports drinks, milk-based beverages, spirits and beer, sauces, dressings, spreads, and personal care items; and plastic caps for various applications. The company sells its products primarily through its direct sales force. Amcor plc was incorporated in 2018 and is headquartered in Z\u00fcrich, Switzerland.","Mondelez International, Inc., through its subsidiaries, manufactures, markets, and sells snack food and beverage products in the Latin America, North America, Asia, the Middle East, Africa, and Europe. It provides biscuits, including cookies, crackers, and salted snacks; chocolates; and gums and candies, as well as various cheese and grocery, and powdered beverage products. The company's snack brand portfolio includes Cadbury, Milka, and Toblerone chocolates; Oreo, belVita, and LU biscuits; Halls candies; Trident gums; and Tang powdered beverages. It serves supermarket chains, wholesalers, supercenters, club stores, mass merchandisers, distributors, convenience stores, gasoline stations, drug stores, value stores, and other retail food outlets through direct store delivery, company-owned and satellite warehouses, third party distributors, and other facilities, as well as through independent sales offices and agents, and e-commerce channels. The company was formerly known as Kraft Foods Inc. and changed its name to Mondelez International, Inc. in October 2012. Mondelez International, Inc. was incorporated in 2000 and is headquartered in Chicago, Illinois.","Enterprise Financial Services Corp operates as the financial holding company for Enterprise Bank &amp; Trust that offers banking and wealth management services to individuals and corporate customers. The company offers checking, savings, and money market accounts, and certificates of deposit. It also provides commercial and industrial, commercial real estate, construction and land development, residential real estate, agricultural, and consumer loans. In addition, the company offers treasury management and international trade services; tax credit brokerage services consisting of the acquisition of tax credits and sale of these tax credits to clients; and financial and estate planning, investment management, and trust services to businesses, individuals, institutions, retirement plans, and non-profit organizations. Further, it offers fiduciary, financial advisory, and merchant processing services; and debit and credit cards. Additionally, the company provides international banking, insurance, internet and mobile banking, remote deposit capture, positive pay, fraud detection and prevention, automated payable, check imaging, and statement and document imaging services; and cash management products, controlled disbursements, repurchase agreements, and sweep investment accounts. It operates banking locations and administrative offices in Arizona, California, Kansas, Missouri, Nevada, and New Mexico market areas, as well as a network of SBA loan production offices and deposit production offices in various states. Enterprise Financial Services Corp was founded in 1988 and is headquartered in Clayton, Missouri.","Enterprise Bancorp, Inc. operates as the holding company of Enterprise Bank and Trust Company that provides commercial banking products and services. It offers commercial and retail deposit products, including checking accounts, limited-transactional savings and money market accounts, commercial sweep products, and term certificates of deposit. The company also provides commercial real estate, commercial and industrial, commercial construction, residential, and consumer loans, as well as home equity loans and lines of credit. In addition, the company offers cash management services; wealth advisory and management services that include customized investment management and trust services to individuals, family groups, commercial businesses, trusts, foundations, non-profit organizations, and endowments; brokerage and management services to individual investors; insurance services; and voice, online, and mobile banking services. As of January 27, 2022, it had 26 full-service branches located in the Massachusetts communities of Acton, Andover, Billerica, Chelmsford, Dracut, Fitchburg, Lawrence, Leominster, Lexington, Lowell, Methuen, North Andover, Tewksbury, Tyngsborough, and Westford; and in the New Hampshire communities of Derry, Hudson, Nashua, Pelham, Salem, and Windham. The company was founded in 1989 and is headquartered in Lowell, Massachusetts.","First Capital, Inc. operates as the bank holding company for First Harrison Bank that provides various banking services to individuals and business customers. The company offers various deposit instruments, including non-interest bearing checking accounts, negotiable order of withdrawal accounts, money market accounts, regular savings accounts, certificates of deposit, and retirement savings plans. It also provides real estate mortgage loans, such as fixed-rate and adjustable rate mortgage residential loans, construction loans for residential and commercial properties, and commercial real estate loans, as well as commercial business loans. In addition, the company originates mortgage loans for sale in the secondary market and sells non-deposit investment products; and offers various secured or guaranteed consumer loans comprising automobile and truck loans, home equity loans, home improvement loans, boat loans, mobile home loans, and loans secured by savings deposits, as well as unsecured consumer loans. It provides its products and services through 18 locations in Indiana and Kentucky. First Capital, Inc. was founded in 1891 and is based in Corydon, Indiana.","Cogent Communications Holdings, Inc., through its subsidiaries, provides high-speed Internet access, private network, and data center colocation space services in North America, Europe, Asia, South America, Australia, and Africa. The company offers on-net Internet access and private network services to law firms, financial services firms, and advertising and marketing firms, as well as heath care providers, educational institutions and other professional services businesses, other Internet service providers, telephone companies, cable television companies, Web hosting companies, media service providers, mobile phone operators, content delivery network companies, and commercial content and application service providers. It also provides Internet access and private network services to customers that are not located in buildings directly connected to its network; and on-net services to customers located in buildings that are physically connected to its network. In addition, the company offers off-net services to corporate customers using other carriers' circuits to provide the last mile portion of the link from the customers' premises to the network. Further, it operates data centers that allow its customers to collocate their equipment and access the network. The company operates 54 data centers and provides facilities to 3,035 buildings and on-net services to 1,817 to multi-tenant office buildings. It serves primarily to small and medium-sized businesses, communications service providers, and other bandwidth-intensive organizations. Cogent Communications Holdings, Inc. was founded in 1999 and is headquartered in Washington, the District of Columbia.","The First Bancshares, Inc. operates as the bank holding company for The First, A National Banking Association that provides general commercial and retail banking services. The company operates through three segments: Commercial/Retail Bank, Mortgage Banking Division, and Holding Company. It offers deposit services, including checking, NOW, and savings accounts; other time deposits, such as daily money market accounts and longer-term certificates of deposit; and individual retirement and health savings accounts. The company also provides commercial loans comprising secured and unsecured loans for working capital, business expansion, and purchase of equipment and machinery; consumer loans consisting of equity lines of credit, as well as secured and unsecured loans for financing automobiles, home improvements, education, and personal investments; and real estate construction and acquisition loans. In addition, it originates loans to purchase existing residential homes or construct new homes, and to refinance existing mortgages; and provides financial and wealth management services. Further, the company offers internet banking services, automated teller machines, voice response telephone inquiry services, commercial sweep accounts, cash management services, safe deposit boxes, merchant, mobile deposit, direct deposit of payroll and social security checks, automatic drafts for various accounts, and credit card services. It primarily serves small to medium-sized businesses, professional concerns, individuals, associations, organizations, and governmental authorities. As of December 31, 2021, the company operated 90 locations in Mississippi, Alabama, Florida, Georgia, and Louisiana. The First Bancshares, Inc. was incorporated in 1995 and is headquartered in Hattiesburg, Mississippi.","Frontdoor, Inc. provides home service plans in the United States. The company's home service plans cover the repair or replacement of principal components of approximately 20 home systems and appliances, including electrical, plumbing, water heaters, refrigerators, dishwashers, and ranges/ovens/cooktops, as well as electronics, pools, and spas and pumps; and central heating, ventilation, and air conditioning systems. It also offers ProConnect on-demand home services business and Streem, a technology platform that uses augmented reality, computer vision, and machine learning that helps home service professionals quickly and accurately diagnose breakdowns and complete repairs. The company serves homeowners under the American Home Shield, HSA, Landmark Home Warranty, OneGuard, Frontdoor, and Streem brands. The company was founded in 1971 and is headquartered in Memphis, Tennessee.",null,"Canadian Solar Inc., together with its subsidiaries, designs, develops, manufactures, and sells solar ingots, wafers, cells, modules, and other solar power and battery storage products in Asia, the Americas, Europe, and internationally. The company operates through two segments, Canadian Solar Inc. (CSI) Solar and Global Energy. The CSI Solar segment offers standard solar modules and battery storage solutions, as well as solar system kits that are a ready-to-install packages comprising inverters, racking systems, and other accessories; and engineering, procurement, and construction (EPC) services. The Global Energy segment engages in the development, construction, maintenance, and sale of solar and battery storage projects; operation of solar power plants; and sale of electricity. This segment also provides operation and maintenance (O&amp;M) services, including monitoring, inspections, repair, and replacement of plant equipment; and site management and administrative support services for solar projects, as well as asset management services. As of January 31, 2021, this segment had a fleet of solar power plants in operation with an aggregate capacity of approximately 445 MWp. The company serves distributors, system integrators, project developers, and installers/EPC companies. It sells its products primarily under its Canadian Solar brand name; and on an OEM basis. The company was incorporated in 2001 and is headquartered in Guelph, Canada.","Commercial Vehicle Group, Inc., together with its subsidiaries, designs, manufactures, produces, and sells components and assemblies in North America, Europe, and the Asia-Pacific regions. It operates in four segments: Vehicle Solutions, Warehouse Automation, Electrical Systems, and Aftermarket &amp; Accessories. The company offers electrical wire harness assemblies that function as current carrying devices in providing electrical interconnections for gauges, lights, control functions, power circuits, powertrain and transmission sensors, emissions systems, and other electronic applications on commercial and other vehicles; and panel assemblies. It also offers electro-mechanical assemblies, such as box builds, complex automated and robotic assemblies, and large multi-cabinet control cabinets with power distribution and cabling; vinyl or cloth-covered appliqu\u00e9s, armrests, map pocket compartments, and sound-reducing insulations; instrument panels; and plastics decorating and finishing products. In addition, it provides cab structures; design products, including armrests, grab handles, storage systems, floor coverings, floor mats, sleeper bunks, headliners, wall panels, and privacy curtains; and mirrors, wipers, and controls used in commercial, military and specialty recreational vehicles. Further, it offers seats and seating systems, such as mechanical and air suspension, static and military seats, and bus, as well as seats for medium-and heavy-duty trucks (MD/HD trucks); office seating products; and seats, parts, and components for the aftermarket. The company supplies its products and systems for the commercial vehicle market comprising the MD/HD truck market; and MD/HD truck, bus, construction, mining, agricultural, military, industrial, municipal, off-road recreational, and specialty vehicle markets. Commercial Vehicle Group, Inc. was incorporated in 2000 and is headquartered in New Albany, Ohio.","Great Elm Group, Inc. engages in the durable medical equipment and investment management businesses. The company distributes respiratory care equipment, including positive air pressure equipment and supplies, ventilators and oxygen equipment, and replacement parts, as well as provides sleep study services; and rents medical equipment. It also offers investment management services. The company was formerly known as Great Elm Capital Group, Inc. and changed its name to Great Elm Group, Inc. in December 2020. Great Elm Group, Inc. was founded in 1994 and is headquartered in Waltham, Massachusetts.","DocGo, Inc. provides mobile health and medical transportation services for various health care providers in the United States and the United Kingdom. The company's transportation services include emergency response services; and non-emergency transport services comprise ambulance and wheelchair transportation services. It also offers mobile health services through its platform that are performed at home and offices; COVID-19 testing; and event services, which include on-site healthcare support at sporting events and concerts. DocGo, Inc. was incorporated in 2015 and is headquartered in New York, New York.","Domo, Inc. operates a cloud-based business intelligence platform in the United States, Japan, and internationally. Its platform digitally connects from the chief executive officer to the frontline employee with the people, data, and systems in an organization, giving them access to real-time data and insights, and allowing them to manage business from smartphones. The company was formerly known as Domo Technologies, Inc. and changed its name to Domo, Inc. in December 2011. Domo, Inc. was incorporated in 2010 and is headquartered in American Fork, Utah.","FLJ Group Limited operates a long-term apartment rental platform in the People's Republic of China. The company leases apartments from landlords, transforms them into standardized furnished rooms, and leases to people. It also provides internet connection and utility services as part of the lease agreement. The company was formerly known as Q&amp;K International Group Limited and changed its name to FLJ Group Limited in September 2022. FLJ Group Limited was founded in 2012 and is based in Shanghai, the People's Republic of China.","GDEV Inc. operates as a gaming and entertainment company in the United States, Europe, Asia, and internationally. It develops desktop, mobile, web, and social games. The company was formerly known as Nexters Inc. and changed its name to GDEV Inc. in June 2023. GDEV Inc. was founded in 2010 and is headquartered in Limassol, Cyprus.","Gilat Satellite Networks Ltd., together with its subsidiaries, provides satellite-based broadband communication solutions in Israel and internationally. It operates through Fixed Networks, Mobility Solutions, and Terrestrial Infrastructure Projects segments. The company designs and manufactures ground-based satellite communications equipment; and provides solutions and end-to-end services. Its portfolio consists of very small aperture terminals, amplifiers, modems, on-the-move antennas, solid state power amplifiers, block upconverters, transceivers, low-profile antennas, and on-the-move/on-the-pause terminals and modems. The company also offers turnkey integrated solutions, including managed satellite network services, network planning and optimization, satellite capacity, remote network operation, call center support, hub and field operations, and communication networks construction and installation services. In addition, it provides connectivity services, Internet access, and telephony services to enterprise, government, and residential customers; and builds telecommunication infrastructure using fiber-optic and wireless technologies for broadband connectivity. The company sells its products and solutions to communication service providers, satellite operators, governments, mobile network operators, telecommunication companies, and system integrators, as well as to defense and homeland security organizations, and directly to end-users. Gilat Satellite Networks Ltd. was incorporated in 1987 and is headquartered in Petah Tikva, Israel.","GLPI is engaged in the business of acquiring, financing, and owning real estate property to be leased to gaming operators in triple-net lease arrangements, pursuant to which the tenant is responsible for all facility maintenance, insurance required in connection with the leased properties and the business conducted on the leased properties, taxes levied on or with respect to the leased properties and all utilities and other services necessary or appropriate for the leased properties and the business conducted on the leased properties.","Gogo Inc., through its subsidiaries, provides broadband connectivity services to the aviation industry in the United States and internationally. It operates through Commercial Aviation North America (CA-NA), Commercial Aviation Rest of World (CA-ROW), and Business Aviation (BA) segments. The company design, build and operate air-to-ground networks, engineer and maintain in-flight systems of proprietary hardware and software, and deliver customizable connectivity and wireless entertainment services. It also offers suite of integrated equipment, network, and internet connectivity products and services, as well as includes suite of smart cabin systems for integrated connectivity, in-flight entertainment, and voice solutions. In addition, the company portfolio comprises of in-flight network, in-flight systems, in-flight services, aviation partner support, and production operations functions. Further, the company offers satellite-based voice and data services. Gogo Inc. was founded in 1991 and is headquartered in Broomfield, Colorado.","Las Vegas Sands Corp., together with its subsidiaries, develops, owns, and operates integrated resorts in Asia and the United States. It owns and operates The Venetian Macao Resort Hotel, the Londoner Macao, The Parisian Macao, The Plaza Macao and Four Seasons Hotel Macao, Cotai Strip, and the Sands Macao in Macao, the People's Republic of China; and Marina Bay Sands in Singapore. The company also owns and operates The Venetian Resort Hotel Casino on the Las Vegas Strip; and the Sands Expo and Convention Center in Las Vegas, Nevada. Its integrated resorts feature accommodations, gaming, entertainment and retail malls, convention and exhibition facilities, celebrity chef restaurants, and other amenities. Las Vegas Sands Corp. was founded in 1988 and is based in Las Vegas, Nevada.","Uber Technologies, Inc. develops and operates proprietary technology applications in the United States, Canada, Latin America, Europe, the Middle East, Africa, and the Asia Pacific. It connects consumers with independent providers of ride services for ridesharing services; and connects riders and other consumers with restaurants, grocers, and other stores with delivery service providers for meal preparation, grocery, and other delivery services. The company operates through three segments: Mobility, Delivery, and Freight. The Mobility segment provides products that connect consumers with mobility drivers who provide rides in a range of vehicles, such as cars, auto rickshaws, motorbikes, minibuses, or taxis. It also offers financial partnerships, transit, and vehicle solutions offerings. The Delivery segment allows consumers to search for and discover local restaurants, order a meal, and either pick-up at the restaurant or have the meal delivered; and offers grocery, alcohol, and convenience store delivery, as well as select other goods. The Freight segment connects carriers with shippers on the company's platform and enable carriers upfront, transparent pricing, and the ability to book a shipment, as well as transportation management and other logistics services offerings. The company was formerly known as Ubercab, Inc. and changed its name to Uber Technologies, Inc. in February 2011. Uber Technologies, Inc. was founded in 2009 and is headquartered in San Francisco, California."],"shape":[99],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Mr. Reece A. Kurtenbach","Mr. Randall D. Sampson CPA","Mr. Gregg C. Sengstack","Mr. Guy  Bernstein","Mr. Guy  Bernstein","Mr. Guy  Bernstein","Mr. Guy  Bernstein","Mr. Dominic F. Silvester","Mr. Michael R. McMullen","Jason Walter Reese","Mr. Terrence R. Curtin CPA","Mr. Richard J. O'Neil Jr.","Mr. Jon R. Moeller","Mr. Donald E. Gibson","Mr. Pascal  Soriot D.V.M., M.B.A.","Mr. Mark K. Hardwick","Mr. Mark K. Hardwick","Mr. Mark K. Hardwick","Mr. Mark K. Hardwick","Mr. Curtis J. Myers","Mr. D. Neil Dauby","Mr. Timothy J. McGrath","Mr. Kevin P. Hourican","Mr. Mark A. Clouse","Mr. Gregory S. Bentley","Mr. Alejandro  Gustavo Elsztain","Mr. Warren G. Lichtenstein","Mr. Matthew Dov Kaplan","Mr. In Keuk  Kim",null,"Mr. Walter Richard Wheeler","Ms. Yilin  Wang","Mr. Rafi  Amit","Mr. Adam Arash Foroughi","Mr. Elon R. Musk","Mr. Timur Ruslanovich Turlov","Mr. Timur Ruslanovich Turlov","Mr. Timur Ruslanovich Turlov","Mr. Timur Ruslanovich Turlov","Mr. Timothy M. Archer","Mr. Gayn  Erickson","Mr. Douglas Vernon Reynolds","Mr. Edward B. Meyercord III","Mr. Kenneth S. Wilson","Mr. Gary E. Dickerson","Mr. Hock E. Tan","Dr. Frank H. Laukien Ph.D.","Mr. Eli  Yaffe","Mr. Timothy D. Cook","Mr. Richard P. Wallace","Mr. Paul J. Romanowski","Mr. John A. Martins","Ms. Julie T. Spellman Sweet","Mr. Theodore A. Sarandos","Mr. Blake L. Sartini Sr.","Mr. Joel D. Anderson","Mr. Vineet A. Nargolwala","Mr. Gregory S. Smith","Mr. Charles Hanson Gillespie","Mr. Bruce F. Young","Mr. Steven J. Hislop","Mr. Laxman  Narasi
